import React, { useState } from 'react'
import './Bus.css';
import Buyorsell from '../../../mini_comp/Buyrorsell/Buyorsell';


const Bus = () => {
    const [Isbuy, setIsbuy] = useState(true);

    const OnclickBuy = () => {
        setIsbuy(true);

    }
    const OnclickSell = () => {
        setIsbuy(false);
    }
    return (
        <div id='Bus'>
            <div className='Bus'>

                <div id='buyorsell'>
                    <div className='buyorsell'>
                        <ul>
                            <li className={Isbuy ? 'active' : 'notactive'} onClick={OnclickBuy}>
                                Buy
                            </li>
                            <li className={Isbuy ? 'notactive' : 'active'} onClick={OnclickSell}>
                                Sell
                            </li>
                        </ul>
                    </div>

                    <div className={Isbuy ? 'buy_data ' : 'buy_data hide'}>
             <h1>Buy</h1>
                    </div>
                    <div className={Isbuy ? 'sell_data hide' : 'sell_data'}>
                                <h1>Sell</h1>
                    </div>

                </div>
            </div>
        </div>
    )
}

export default Bus
